import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faLocationDot, faPaintbrush, faBars, faTimes } from '@fortawesome/free-solid-svg-icons';

export function Nav() {
  const [showMenu, setShowMenu] = useState(false);

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  }

  return (
    <nav>
      <div className="nav-header">
        <div className="nav-logo">
          <NavLink exact to='/'><FontAwesomeIcon icon={faPaintbrush} /> ArtHive</NavLink>
        </div>
        <div className="nav-toggle">
          <button onClick={toggleMenu}>
            {showMenu ? <FontAwesomeIcon icon={faTimes} /> : <FontAwesomeIcon icon={faBars} />}
          </button>
        </div>
      </div>
      <ul className={`nav-menu ${showMenu ? "show" : ""}`} role="menubar">
        <li role="tab"> <NavLink exact to='/gallery' activeClassName="active-tab">Gallery</NavLink> </li>
        <li role="tab"> <NavLink exact to='/sellers' activeClassName="active-tab">Sellers</NavLink> </li>
        <li role="tab"> <NavLink exact to="/profile" activeClassName="active-tab">Profile</NavLink> </li>
      </ul>
    </nav>
  );
}
